function setupScatter(t,e,a,l){var s=document.getElementById(t).getContext("2d");return Chart.Scatter(s,{data:{datasets:[{label:a,data:e,backgroundColor:["rgba(255, 80, 90, 0.6)"]}]},options:{scales:{yAxes:[{ticks:{beginAtZero:!0,fontSize:14,min:0,max:l[1]},scaleLabel:{display:!0,labelString:a.split("/")[1]}}],xAxes:[{ticks:{fontSize:14,min:0,max:l[0]},scaleLabel:{display:!0,labelString:a.split("/")[0]}}]}}})}